import './App.css';
import { Layout, Menu, Breadcrumb, Row, Col } from 'antd';
import Header from './components/header';

const { Content, Footer } = Layout;

function App() {
  return (
    <div>
      {/* <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
